export default function MyTickets() {
  



  return (
    <section>
      <h3>My Tickets</h3>
       <section className="tickets">
      {setUserTicket.map((ticket, index) => 
    <table key={index}>
      <thead>
        <tr>
          <th>Tour Name</th>
          <th>Payment Method</th>
          <th>Price</th>
   
          <th>Status</th>
        </tr>
      </thead>
